import React from 'react';
import Logo from './img/xzerologo.png'; 

function App() {
  return (
    <div className="App">
      <img src={Logo} />
        <div className="brand">
          <h1><a href="##"><span>Webhook</span> Discord Sender</a></h1>
        </div>
    </div>
  );
}

export default App;
